//images.ctfassets.net/gp0z6a51zbh5/1qzivJMO7kU65JzKPdP43e/ee0c5eb6707fa4a24e4b62ee65b85a98/TrilityConsulting.png?w=900&h=900&q=50 900w,\\n//images.ctfassets.net/gp0z6a51zbh5/1qzivJMO7kU65JzKPdP43e/ee0c5eb6707fa4a24e4b62ee65b85a98/TrilityConsulting.png?w=2400&h=2400&q=50 2400w","aspectRatio":1,"sizes":"(max-width: 300px) 100vw, 300px"}}}}]},"allContentfulSpeakers":{"edges":[{"node":{"name":"Kelsey Janda","slug":"kelseyjanda","company":"Previously Hudl","session":"Learning by Making: happier product team & customers ","title":"Previously Vice President of Design","abstract":{"json":{"data":{},"content":[{"data":{},"content":[{"data":{},"marks":[],"value":"Often we’re stuck making one idea to solve a problem or fit acceptance criteria. At Hudl, we shook that up. We coined the phrase “learning by making” and asked every role (product mangers, engineers, scrum masters, designers, quality analysts) to make prototypes. It was messy (like really messy) and didn’t always work. We threw away a lot of attempts. But sometimes messy is the magic. This work resulted in a happier team, not just happier designers. Users and customers were involved more than ever. I’ll share actual stories of when this worked and when it fell flat. I’ll include principles we learned along the way and how managers + leaders play crucial roles.  ","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"document"}},"image":{"fluid":{"src":"//images.ctfassets.net/gp0z6a51zbh5/3SlilP3yzq8h2S7vz3adXl/976b1c45b5bc64c4873b6bab6985c4c1/KelseyJanda.png?w=300&q=50","srcSet":"//images.ctfassets.net/gp0z6a51zbh5/3SlilP3yzq8h2S7vz3adXl/976b1c45b5bc64c4873b6bab6985c4c1/KelseyJanda.png?w=75&h=75&q=50 75w,\\n//images.ctfassets.net/gp0z6a51zbh5/3SlilP3yzq8h2S7vz3adXl/976b1c45b5bc64c4873b6bab6985c4c1/KelseyJanda.png?w=150&h=150&q=50 150w,\\n//images.ctfassets.net/gp0z6a51zbh5/3SlilP3yzq8h2S7vz3adXl/976b1c45b5bc64c4873b6bab6985c4c1/KelseyJanda.png?w=300&h=300&q=50 300w,\\n//images.ctfassets.net/gp0z6a51zbh5/3SlilP3yzq8h2S7vz3adXl/976b1c45b5bc64c4873b6bab6985c4c1/KelseyJanda.png?w=450&h=450&q=50 450w,\\n//images.ctfassets.net/gp0z6a51zbh5/3SlilP3yzq8h2S7vz3adXl/976b1c45b5bc64c4873b6bab6985c4c1/KelseyJanda.png?w=600&h=600&q=50 600w","aspectRatio":1,"sizes":"(max-width: 300px) 100vw, 300px"}}}},{"node":{"name":"Erica Cuttitta","slug":"ericacuttitta","company":"Pluralsight","session":"Systems, code and APIs…, but first, humans","title":"Sr. Director of Engineering","abstract":{"json":{"data":{},"content":[{"data":{},"content":[{"data":{},"marks":[],"value":"We are all driven by continuous improvement, high quality and value for our customers. But the key to success in all-the-things, is a human-first approach. Your team members are the most important resource you have. Learn how a human-first approach can create high performing, value-driven teams that build loyalty and a pipeline of engaged humans to power your company forward. \\n\\n\\nTranslation for Techies: \\n>SELECT * FROM ‘SYSTEM_HEALTH’\\n     WHERE system_quality =  ‘HIGHEST’\\n           AND value = ‘MOST_VALUABLE’\\n           AND deployment_strategy =  ‘CONTINUOUS DEPLOYMENT’;\\n\\nSYSTEM HEALTH\\n   HUMANS-FIRST","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"document"}},"image":{"fluid":{"src":"//images.ctfassets.net/gp0z6a51zbh5/3EDWcWoyyyKh92nV1Hj7Y5/f24e7adc8361111eb75d21302588537a/ErikaCuttitta.png?w=300&q=50","srcSet":"//images.ctfassets.net/gp0z6a51zbh5/3EDWcWoyyyKh92nV1Hj7Y5/f24e7adc8361111eb75d21302588537a/ErikaCuttitta.png?w=75&h=75&q=50 75w,\\n//images.ctfassets.net/gp0z6a51zbh5/3EDWcWoyyyKh92nV1Hj7Y5/f24e7adc8361111eb75d21302588537a/ErikaCuttitta.png?w=150&h=150&q=50 150w,\\n//images.ctfassets.net/gp0z6a51zbh5/3EDWcWoyyyKh92nV1Hj7Y5/f24e7adc8361111eb75d21302588537a/ErikaCuttitta.png?w=300&h=300&q=50 300w,\\n//images.ctfassets.net/gp0z6a51zbh5/3EDWcWoyyyKh92nV1Hj7Y5/f24e7adc8361111eb75d21302588537a/ErikaCuttitta.png?w=450&h=450&q=50 450w,\\n//images.ctfassets.net/gp0z6a51zbh5/3EDWcWoyyyKh92nV1Hj7Y5/f24e7adc8361111eb75d21302588537a/ErikaCuttitta.png?w=600&h=600&q=50 600w","aspectRatio":1,"sizes":"(max-width: 300px) 100vw, 300px"}}}},{"node":{"name":"Nate Hales","slug":"natehales","company":"Riot Games","session":"Holistic Quality: More Than Just Testing","title":"Sr. QA Lead","abstract":{"json":{"data":{},"content":[{"data":{},"content":[{"data":{},"marks":[],"value":"Quality is everyone\'s responsibility. By shifting left and using a variety of techniques, teams can ensure they are driving towards the highest quality deliverable possible. It starts with empower your own QA to perform quality activities beyond just testing. In this talk we will explore how QA can be involved at all steps during the development process and what kinds of activities they are best suited to perform.","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"document"}},"image":{"fluid":{"src":"//images.ctfassets.net/gp0z6a51zbh5/6up6Y8Z2kOtt8gg0mAlsEb/f40de7936b6b1ec2082ff2acdc6b4395/NateHales.png?w=300&q=50","srcSet":"//images.ctfassets.net/gp0z6a51zbh5/6up6Y8Z2kOtt8gg0mAlsEb/f40de7936b6b1ec2082ff2acdc6b4395/NateHales.png?w=75&h=75&q=50 75w,\\n//images.ctfassets.net/gp0z6a51zbh5/6up6Y8Z2kOtt8gg0mAlsEb/f40de7936b6b1ec2082ff2acdc6b4395/NateHales.png?w=150&h=150&q=50 150w,\\n//images.ctfassets.net/gp0z6a51zbh5/6up6Y8Z2kOtt8gg0mAlsEb/f40de7936b6b1ec2082ff2acdc6b4395/NateHales.png?w=300&h=300&q=50 300w,\\n//images.ctfassets.net/gp0z6a51zbh5/6up6Y8Z2kOtt8gg0mAlsEb/f40de7936b6b1ec2082ff2acdc6b4395/NateHales.png?w=450&h=450&q=50 450w,\\n//images.ctfassets.net/gp0z6a51zbh5/6up6Y8Z2kOtt8gg0mAlsEb/f40de7936b6b1ec2082ff2acdc6b4395/NateHales.png?w=600&h=600&q=50 600w","aspectRatio":1,"sizes":"(max-width: 300px) 100vw, 300px"}}}},{"node":{"name":"Rhia Dixon","slug":"rhiadixon","company":"VMLY&R","session":"It\'s All Relative: The Science of Debugging","title":"Associate Director of Technology","abstract":{"json":{"nodeType":"document","data":{},"content":[{"nodeType":"paragraph","data":{},"content":[{"nodeType":"text","value":"Most people don\'t realize they do math every day, and I\'m guessing most people also don\'t consider they\'re using science every day. The Scientific Method isn\'t just a tool for doctors and scientists. If you\'re solving problems, you\'re likely using it too! \\n\\nLet\'s break down how the Scientific Method applies to the Software Development Life Cycle.","marks":[],"data":{}}]}]}},"image":{"fluid":{"src":"//images.ctfassets.net/gp0z6a51zbh5/6AzlX41m8jRy2gQWsdYOQ4/d983e04f7e33c013ab8e52b44d71a77d/RhiaDixon.png?w=300&q=50","srcSet":"//images.ctfassets.net/gp0z6a51zbh5/6AzlX41m8jRy2gQWsdYOQ4/d983e04f7e33c013ab8e52b44d71a77d/RhiaDixon.png?w=75&h=75&q=50 75w,\\n//images.ctfassets.net/gp0z6a51zbh5/6AzlX41m8jRy2gQWsdYOQ4/d983e04f7e33c013ab8e52b44d71a77d/RhiaDixon.png?w=150&h=150&q=50 150w,\\n//images.ctfassets.net/gp0z6a51zbh5/6AzlX41m8jRy2gQWsdYOQ4/d983e04f7e33c013ab8e52b44d71a77d/RhiaDixon.png?w=300&h=300&q=50 300w,\\n//images.ctfassets.net/gp0z6a51zbh5/6AzlX41m8jRy2gQWsdYOQ4/d983e04f7e33c013ab8e52b44d71a77d/RhiaDixon.png?w=450&h=450&q=50 450w,\\n//images.ctfassets.net/gp0z6a51zbh5/6AzlX41m8jRy2gQWsdYOQ4/d983e04f7e33c013ab8e52b44d71a77d/RhiaDixon.png?w=600&h=600&q=50 600w","aspectRatio":1,"sizes":"(max-width: 300px) 100vw, 300px"}}}},{"node":{"name":"Eric Gerling","slug":"ericgerling","company":"Trility Consulting","session":"Lessons Learned from a Lifetime of “No”","title":"DevOps Consultant, Coach and Mentor","abstract":{"json":{"data":{},"content":[{"data":{},"content":[{"data":{},"marks":[],"value":"Tired of hearing “No” when you want to migrate applications to the cloud or leverage new cloud services? Eric Gerling has given and gotten a lot of “Nos” since opening his first cloud account in 2012. While his work in the cloud is not the sole reason he’s lost all his hair, he does hope to save you from scratching your head when working with the decision-makers in your organization. \\n\\nNo matter what your cloud ecosystem, you’ll often hear “No” from every direction. Whether it’s Cloud Engineers, InfoSec, Compliance, C-suite, or just someone writing checks to Azure, AWS, Google Cloud, or any other public cloud. \\n\\nKey Takeaway: You’ll leave with five ways to arm yourself and overcome rejection so what you hear instead is, “So you’re telling me there’s a chance.”","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"document"}},"image":{"fluid":{"src":"//images.ctfassets.net/gp0z6a51zbh5/3P1rLvcwKXC4t8oU8wHjUx/1cb64d874ad4b611011debaeb9f4410b/EricGerling.png?w=300&q=50","srcSet":"//images.ctfassets.net/gp0z6a51zbh5/3P1rLvcwKXC4t8oU8wHjUx/1cb64d874ad4b611011debaeb9f4410b/EricGerling.png?w=75&h=75&q=50 75w,\\n//images.ctfassets.net/gp0z6a51zbh5/3P1rLvcwKXC4t8oU8wHjUx/1cb64d874ad4b611011debaeb9f4410b/EricGerling.png?w=150&h=150&q=50 150w,\\n//images.ctfassets.net/gp0z6a51zbh5/3P1rLvcwKXC4t8oU8wHjUx/1cb64d874ad4b611011debaeb9f4410b/EricGerling.png?w=300&h=300&q=50 300w,\\n//images.ctfassets.net/gp0z6a51zbh5/3P1rLvcwKXC4t8oU8wHjUx/1cb64d874ad4b611011debaeb9f4410b/EricGerling.png?w=450&h=450&q=50 450w,\\n//images.ctfassets.net/gp0z6a51zbh5/3P1rLvcwKXC4t8oU8wHjUx/1cb64d874ad4b611011debaeb9f4410b/EricGerling.png?w=600&h=600&q=50 600w","aspectRatio":1,"sizes":"(max-width: 300px) 100vw, 300px"}}}},{"node":{"name":"Steve Chikwaya","slug":"stevechikwaya","company":"Gallup","session":"The rise of the product minded engineer","title":"Tech Lead","abstract":{"json":{"nodeType":"document","data":{},"content":[{"nodeType":"paragraph","data":{},"content":[{"nodeType":"text","value":"What were they thinking? Do they even use the product? At one point or another, we\'ve all asked this question of products we have to use. We\'ve also been on the receiving end, and defended ourselves by saying \\"they are holding it wrong\\". I\'m here to tell you that it doesn\'t have to be this way.\\n\\nProducts users love, the ones that evoke reactions like \\"simple\\" and  \\"intuitive\\" are the output of high performing teams. These teams are often comprised of a different type of engineer - the product-minded engineer. These engineers engage the \\"why\\" with an eye on solving the customer\'s problem. They understand the business but empathize with the user. They build experiences, not features. \\n\\nProduct-minded engineers aren\'t mythical beasts. They are real, and I\'m here to share my journey on becoming a product-minded engineer. Join me to learn about:\\n\\n- How to help create an environment that empowers product minded engineers\\n- Changing the mindset from feature-driven to product-driven\\n- Lessons learned while pursuing this journey","marks":[],"data":{}}]},{"nodeType":"paragraph","data":{},"content":[{"nodeType":"text","value":"\\n","marks":[],"data":{}}]}]}},"image":{"fluid":{"src":"//images.ctfassets.net/gp0z6a51zbh5/5CMlnIlLuv2aW6iFcDGfAs/aeb0ec8681644911522edc65373dc07d/SteveChikawa.png?w=300&q=50","srcSet":"//images.ctfassets.net/gp0z6a51zbh5/5CMlnIlLuv2aW6iFcDGfAs/aeb0ec8681644911522edc65373dc07d/SteveChikawa.png?w=75&h=75&q=50 75w,\\n//images.ctfassets.net/gp0z6a51zbh5/5CMlnIlLuv2aW6iFcDGfAs/aeb0ec8681644911522edc65373dc07d/SteveChikawa.png?w=150&h=150&q=50 150w,\\n//images.ctfassets.net/gp0z6a51zbh5/5CMlnIlLuv2aW6iFcDGfAs/aeb0ec8681644911522edc65373dc07d/SteveChikawa.png?w=300&h=300&q=50 300w,\\n//images.ctfassets.net/gp0z6a51zbh5/5CMlnIlLuv2aW6iFcDGfAs/aeb0ec8681644911522edc65373dc07d/SteveChikawa.png?w=450&h=450&q=50 450w,\\n//images.ctfassets.net/gp0z6a51zbh5/5CMlnIlLuv2aW6iFcDGfAs/aeb0ec8681644911522edc65373dc07d/SteveChikawa.png?w=600&h=600&q=50 600w","aspectRatio":1,"sizes":"(max-width: 300px) 100vw, 300px"}}}},{"node":{"name":"Rebecca Stavick","slug":"rebeccastavick","company":"Community Information Trust / Do Space","session":"The Omaha Tech Community: An Interactive Discussion","title":"CEO","abstract":{"json":{"data":{},"content":[{"data":{},"content":[{"data":{},"marks":[],"value":"Whether it\'s making new friends or making new professiona